export default class TokenStream {
    constructor(nodes: any, parent: any);
    index: number;
    nodes: any;
    functionName: any;
    lastValue: any;
    rewindIndex: number;
    hasTokens(): boolean;
    matches(...tokenDescriptors: any[]): boolean;
    expect(...tokenDescriptors: any[]): any;
    matchesFunction(): TokenStream | null;
    expectFunction(): void | TokenStream;
    expectEmpty(): void;
    throw(): void;
    saveRewindPoint(): void;
    rewind(): void;
    SYMBOL_MATCH(...tokenDescriptors: any[]): any;
}
